import React, { useState, useRef } from "react";
import makeStyles from "@mui/styles/makeStyles";
import { Grid, Typography, Button, Container } from "@mui/material";
import ReactPlayer from "react-player";
import video from "../Components/About/img/slot.mp4";
import redLine from "../Components/About/img/redLine.svg";
import imgRun from "../Components/About/img/imgRun.svg";
import imgClimb from "../Components/About/img/imgClimb.svg";
import imgStreching from "../Components/About/img/imgStreching.svg";
import imgSwim from "../Components/About/img/imgSwim.svg";
import imgVoleyball from "../Components/About/img/imgVoleyball.svg";
import Line from "../Components/About/img/Line.svg";
import AboutPageButton from "../Components/About/AboutPageButton";

/* import redRing from "../Components/About/img/redRing.svg";
 */ import redCircle from "../Components/About/img/circle.svg";
/* import IconButton from '@mui/material/IconButton';
import Slider from '@mui/material/Slider';
import Tooltip from '@mui/material/Tooltip';
import Popover from '@mui/material/Popover';
import {
  FastRewindIcon, FastForwardIcon,
  PlayArrowIcon, PauseIcon, FullScreenIcon, VolumeUpIcon
} from '@mui/icons-material'; */
import VideoPlayerControls from "../Components/About/VideoPlayerControls";
import HistoryPage from "../Components/About/history";
// import screenfull from 'screenfull';

const useStyles = makeStyles((theme) => ({
  main: {
    background: "linear-gradient(360deg, #FFF 0%, #F4F5F7 100%)",
    mixBlendMode: "normal",
    maxWidth: "1600px",
    margin: "auto",
  },
  about: {
    marginTop: "80px",
  },
  playerWrapper: {
    width: "100%",
    position: "relative",
  },
  playerContainer: {
    marginTop: "50px",
  },
  text: { width: "50%", marginTop: "50px" },
  redLine: { position: "relative", marginLeft: "52%" },
  picturesAndTexts: { background: "#F4F5F7", transform: 0, marginTop: "50px" },
  circleAndRing1: {
    position: "absolute",
    marginLeft: "3.05%",
    marginTop: "15%",
  },
  circleAndRing2: {
    position: "absolute",
    marginLeft: "3.05%",
    marginTop: "42%",
  },
  circleAndRing3: {
    position: "absolute",
    marginLeft: "3.05%",
    marginTop: "69%",
  },
  circleAndRing4: {
    position: "absolute",
    marginLeft: "3.05%",
    marginTop: "96%",
  },
  circleAndRing5: {
    position: "absolute",
    marginLeft: "3.05%",
    marginTop: "123%",
  },
  imgLeft: { padding: " 0px 0 0 0", height: "300px" },
  textLeft: { padding: " 0px 0 0 0", height: "300px" },
  imgRight: { padding: " 0px 0 0 0", height: "300px" },
  textRight: { padding: " 0px 0 0 0", height: "300px" },
  line: { marginTop: "20px" },
}));


export default function About() {
  const classes = useStyles();
  return (
    <Grid
      className={classes.main}
      container
      direction="column"
      justifyContent="center"
      alignItems="center"
    >
      <Grid
        container
        item
        alignItems="center"
        justifyContent="center"
        spacing={8}
      >
        <Grid item xs={7}>
          <Typography
            variant="subtitle1"
            className={classes.about}
            color="primary"
          >
            Hakkimizda
          </Typography>
        </Grid>

        <Grid item xs={7}>
          <AboutPageButton Text={"Tarihcemiz"}></AboutPageButton>
          <AboutPageButton Text={"Politikalar"}></AboutPageButton>
          <AboutPageButton Text={"Neden Biz?"}></AboutPageButton>
          <AboutPageButton Text={"Sirket Bilgileri"}></AboutPageButton>
        </Grid>
      </Grid>

      <img src={Line} className={classes.line} />

      <HistoryPage/>
    </Grid>
  );
}
